import React from 'react';
import './App.css';
import Title from './components/Title';
import WordForm from './components/WordForm';

const url = 'https://api.twitter.com/1.1/search/tweets.json';

function App() {
  return (
    <div className="App">
      <Title></Title>
      <WordForm></WordForm>
    </div>
  );
}

export default App;
